iShop.HelpCenter.Views.HelpCenterSearchResults=Backbone.View.extend({template:HandlebarsTemplates["help_center/search_results"],events:{"click .results > li":"showTopic"},initialize:function(){this.eventAggregator.on("render:results",this.render,this)},render:function(e){this.$el.html(this.template(e))},showTopic:function(e){e.preventDefault();var t=$(e.toElement).parent("li").attr("id");this.eventAggregator.trigger("render:result",t)}});